import React from "react";
import MainSkeleton from "./Containers/Layout";
import { BaseRouter } from "./routes";
import { BrowserRouter as Router } from "react-router-dom";
// import ClassicFormPage from "./Containers/Front";

function App() {
  return (
    <div>
      <Router>
        <MainSkeleton>
          <BaseRouter />
        </MainSkeleton>
      </Router>
    </div>
  );
}
export default App;
